class Enemy extends Animation{constructor(t,i,s,e,h,a,d,r,n,o){super(t,i,s,e,h,a,d,r),this.originalX=s,this.originalSpeed=n,this.speed=n,this.delay=o,this.hasCollided=!1}setSpeed(t){this.speed=t}move(){this.x=this.x-this.speed,this.x<-this.characterWidth-this.delay&&(this.x=width)}stop(){this.x<-this.characterWidth&&this.setSpeed(0)}restart(){this.x=this.originalX,this.setSpeed(this.originalSpeed),this.animate()}}